import React from 'react';
import DatePicker from "react-datepicker";
import './Card.scss'
function Card(){
    let date=new Date();
    return(<div>
        <div className="inputs">
            <label>
                Credit/Debit/ATM card
            </label>
            <input type="text" placeholder="Enter Card Number"/>
            <DatePicker className="datepicker" selected={date} dateFormat="MM/dd/yyyy"/>

        </div>
    </div>)
    
}

export default Card;
